function Recipie({ search, levelFilter, ratingFilter, timeFilter }) {
  const filteredRecipes = recipes.filter((dish) => {
    const matchesSearch = search
      ? dish.name.toLowerCase().includes(search.toLowerCase())
      : true;
    const matchesLevel = levelFilter ? dish.level === levelFilter : true;
    const matchesRating = ratingFilter
      ? dish.rating >= parseFloat(ratingFilter)
      : true;
    const matchesTime = timeFilter
      ? parseInt(dish.cookingTime) <= parseInt(timeFilter)
      : true;

    return matchesSearch && matchesLevel && matchesRating && matchesTime;
  });

  return (
    <div
      style={{
        height: "529px",
        width:"339px",
        overflowY: "scroll",
        marginLeft:"5px",
        border: "0px  solid #ccc",
        scrollbarWidth: "none",
        msOverflowStyle: "none",
        scrollBehavior: "smooth",
        
      }}
    >
      <style>
        {`
          div::-webkit-scrollbar {
            display: none;
          }
        `}
      </style>

      {filteredRecipes.length > 0 ? (
        filteredRecipes.map((dish) => (
          <Remage
            key={dish.id}
            image={dish.image}
            name={dish.name}
            level={dish.level}
            cookingTime={dish.cookingTime}
            rating={dish.rating}
          />
        ))
      ) : (
        <p style={{ textAlign: "center", marginTop: "20px" }}>❌ No match found</p>
      )}
    </div>
  );
}

export default Recipie;

